#!/usr/bin/env python3

# Functions 
def printTitle():
    print("\n\033[92m _____                                   _____                _")
    print("|  __ \                                 / ____|              | |")
    print("| |__) |__ _ __ ___  ___  _ __   __ _  | |     _ __ ___  __ _| |_ ___  _ __ ")
    print("|  ___/ _ \ '__/ __|/ _ \| '_ \ / _` | | |    | '__/ _ \/ _` | __/ _ \| '__|")
    print("| |  |  __/ |  \__ \ (_) | | | | (_| | | |____| | |  __/ (_| | || (_) | |")
    print("|_|   \___|_|  |___/\___/|_| |_|\__,_|  \_____|_|  \___|\__,_|\__\___/|_|\033[0m\n")

def errorMsg(text):
    print("\n\033[93m" + text + "\033[0m")

def infoMsg(text):
    print("\n\033[94m" + text + "\033[0m\n")

def getAge(name):
    age = input("How old is " + name + "? ").strip()
    if age.isdigit() and int(age) <= 120:
        age = int(age)  
    else:
        errorMsg("Please provide an integer value from 0 to 120 (you doughnut!)")
        age = getAge(name)
    return age

def getSelection():
    available = [1, 2, 3, 4]    
    infoMsg("Would you like to add any optional items?")
    if 1 not in getSelection.previous:
        print("[1] A list of frustrations.")
    else:
        available.remove(1)
    if 2 not in getSelection.previous:
        print("[2] A list of skills.")
    else:
        available.remove(2)
    print("[3] A custom field.")
    print("[4] I'm finished thank you.\n")

    selection = input("Please enter a number to select one of the above: ").strip()
    if selection.isdigit() and int(selection) in available:
        selection = int(selection)
        getSelection.previous.append(selection)
    else:
        errorMsg("Please make a valid selection.")
        selection = getSelection()

    return selection
getSelection.previous = []

def insertMultiple(name, itemName = "goal"):
    items = []
    end = False
    while (end == False):
        item = input("Enter a " + itemName + " (or type 'done' to finish): ").strip()
        if item.lower() == "done":
             end = True 
             infoMsg("Thank you for proving " + itemName + "s for " + name + ".")
        else:
            items.append(item)
    return items

def printItemList(items, itemName = "goals", qty = 5):
    totalCount = len(items)
    visibleCount = totalCount
    if visibleCount > qty:
        visibleCount = qty
    infoMsg("The first " + str(visibleCount) + " " + itemName + "(s) are as follows:")

    for i in range(visibleCount):
        print(items[i])

    infoMsg("...(of " + str(totalCount) + ") \n")

def avatarSelector(age, gender):
    if gender.lower() == "male":
        if age <= 19:
            return avatars[5]
        elif age <= 29:
            return avatars[0]
        elif age <= 39:
            return avatars[7]
        elif age <= 64:
            return avatars[1]
        else:
            return avatars[3]
    elif gender.lower() == "female":
        if age <= 19:
            return avatars[6]
        elif age <= 29:
            return avatars[9]
        elif age <= 39:
            return avatars[8]
        elif age <= 64:
            return avatars[2]
        else:
            return avatars[4]
    else: 
        return avatars[10]

# Data to be collected
data = {"name": "", "age": 0, "gender": "", "occupation": "", "lifeDay": "", "goals": [], "frustrations": [], "skills": []}

# Config 
filePrefix = "persona-"
vowels = ["a", "e", "i", "o", "u"]
avatars = (
    # black_man
    "data:image/png;base64,",
    # brown_man   
    "data:image/png;base64,",
    # brown_woman
    "data:image/png;base64,",
    # grey_man
    "data:image/png;base64,",
    # grey_woman
    "data:image/png;base64,",
    # orange_boy
    "data:image/png;base64,",
    # orange_girl
    "data:image/png;base64,",
    # red_man
    "data:image/png;base64,",
    # red_woman
    "data:image/png;base64,",
    # white_woman
    "data:image/png;base64,",
    # other
    "data:image/png;base64,")

# Markup 
pageCss  = "@import url('http://fonts.googleapis.com/css?family=Open+Sans:700,400,300);');"
pageCss += "body, html {font: 1em/1.5 'Open Sans', sans-serif; color: #333;}"
pageCss += "header {min-height: 128px; clear: both; border-bottom: 1px solid #ddd; padding: 2% 0; margin-bottom: 4%;}"
pageCss += "img {float: left; margin-right: 3%;}" 
pageCss += "h1, h2 {font-weight: 300; margin: 1% 0;}"
pageCss += ".wrapper {max-width: 920px; margin: 0 auto;}" 
pageCss += ".main {width: 62%; float: left; border-right: 1px dotted #ddd; padding-right: 4%;}" 
pageCss += ".secondary {width: 30%; float: right;}" 
pageCss += " span.occupation {font-style: italic;}"
pageCss += " span.occupation:before {content: '- '}"
pageStart = '<html> <head> <title>Personas</title> <style>' + pageCss + '</style> </head> <body> <div class="wrapper">'
pageEnd = '</div> </body> </html>'

# Startup 
printTitle()

infoMsg("\033[1mWelcome to the Persona Creator tool.\n" + \
    "Persona Creator was developed by Sam Lashenko and Elodie Som at Honeystone Consulting Ltd.")

# Collect name and age 
data["name"] = input("Think of a name?... any name... (but not Bob!): ").strip()
data["age"] = getAge(data["name"])

# Collect gender
gender = input("What is the gender of " + data["name"] + " ([M]ale/[F]emale/[O]ther)? ").lower().strip()
if gender == "m" or gender == "male":
    data["gender"] = "Male"
elif gender == "f" or gender == "female":
    data["gender"] = "Female"
else:
    data["gender"] = "Other"

# Collect occupation and lifeDay 
data["occupation"] = input("What is their occupation? ").strip()
data["lifeDay"] = input("Briefely describe a day in the life of " + data["name"] + ". Be creative!! ").strip()

# Collect goals 
data["goals"] = insertMultiple(data["name"])

# Preparing occupation for sentence
if data["occupation"][0].lower() in vowels:
    occupationStr = "an " + data["occupation"]
else:
    occupationStr = "a " + data["occupation"]

# Persona introduction 
print("Meet " + data["name"] + " a " + str(data["age"]) + " year old " + data["gender"] + ".", 
    data["name"] + " works as " + occupationStr + ".",
    "A day in the life of " + data["name"] + ": " + data["lifeDay"], sep = "\n")

# Goals list
printItemList(data["goals"])

# Optional items
selection = 0
while selection != 4: 
    selection = getSelection()
    if selection != 4:
        if selection == 1:
            data["frustrations"] = insertMultiple(data["name"], "frustration")
            printItemList(data["frustrations"])
        elif selection == 2:
            data["skills"] = insertMultiple(data["name"], "skill")
            printItemList(data["skills"])
        else:
            print("Maybe later!")

# Begin writing html document
fileName = filePrefix + data["name"].lower() + ".html"
f = open(fileName, "w")
f.write(pageStart)
f.close()

# Html document
# Left side
html  = '<header>' # Open header
html += '<img src="' + avatarSelector(data["age"], data["gender"]) + '" alt="Persona avatar" />'
html += '<h1>' + data["name"] + ', ' + str(data["age"]) + ', ' + data["gender"] + '</h1>'
html += '<span class="occupation">' + data["occupation"] + '</span>'
html += '</header>' # Close header
html += '<div class="main">' # Open main
html += '<section class="goals">' # Open goals section
html += '<h2>Goals</h2>'
html += '<p>The following goals have been identified:</p>'
html += '<ol>' # Open goals list
for goal in data["goals"]:
    html += '<li>' + goal + '</li>'
html += '</ol>' # Close goals list
html += '</section>' # Close goals section

if len(data["frustrations"]) != 0:
    html += '<section class="frustrations">' # Open frustrations section
    html += '<h2>Frustrations</h2>'
    html += '<p>The following frustrations have been identified:</p>'
    html += '<ol>' # Open frustrations list
    for frustration in data["frustrations"]:
        html += '<li>' + frustration + '</li>'
    html += '</ol>' # Close frustrations list
    html += '</section>' # Close frustrations section

if len(data["skills"]) != 0:
    html += '<section class="skills">' # Open skills section
    html += '<h2>Skills</h2>'
    html += '<p>The following skills have been identified:</p>'
    html += '<ol>' # Open skills list
    for skill in data["skills"]:
        html += '<li>' + skill + '</li>'
    html += '</ol>' # Close skills list
    html += '</section>' # Close skills section
html += '</div>' # Close main

# Right side
html += '<aside class="secondary">' # Open secondary as an aside
html += '<section class="life">' # Open a day in the life of section
html += '<h2>A day in the life of ' + data["name"] + '</h2>'
html += '<p>' + data["lifeDay"] + '</p>'
html += '</section>' # Close life section
html += '</aside>' # Close secondary

# Appending the end of the file
f = open(fileName, "a")
f.write(html + pageEnd)
f.close()